import 'ol/ol.css';
import Map from 'ol/Map.js';
import View from 'ol/View.js';
import {defaults as defaultControls} from 'ol/control.js';
import MousePosition from 'ol/control/MousePosition.js';
import {createStringXY} from 'ol/coordinate.js';
import Feature from 'ol/Feature.js';
import GeoJSON from 'ol/format/GeoJSON.js';
import {Tile as TileLayer, Vector as VectorLayer} from 'ol/layer.js';
import {OSM, Vector as VectorSource} from 'ol/source.js';
import {Circle as CircleStyle, Fill, Point, Stroke, Style} from 'ol/style.js';

var feature = null;
var ob = null;
var left = screen.width;
var top = screen.height;


/**************************** Mouse Position **************************************************/
var mousePositionControl = new MousePosition({
  coordinateFormat: createStringXY(4),
  projection: 'EPSG:4326',
  // comment the following two lines to have the mouse position
  // be placed within the map.
  className: 'custom-mouse-position',
  target: document.getElementById('mouse-position'),
  undefinedHTML: '&nbsp;'
});

var projectionSelect = document.getElementById('projection');
projectionSelect.addEventListener('change', function(event) {
  mousePositionControl.setProjection(event.target.value);
});

var precisionInput = document.getElementById('precision');
precisionInput.addEventListener('change', function(event) {
  var format = createStringXY(event.target.valueAsNumber);
  mousePositionControl.setCoordinateFormat(format);
});

/*******************************************************************************/

var image = new CircleStyle({
  radius: 5,
  fill: new Fill({ color: 'green' }),
  stroke: new Stroke({color: 'red', width: 2})
});

var styles = {
  'Point': new Style({
    image: image
  }),
  'LineString': [new Style({
    stroke: new Stroke({
        color: 'green',
        width: 1
    }),
  'Name': new Text()
})],
  text: new Text()
};

var styleFunction = function(feature) {
  return styles[feature.getGeometry().getType()];
};

var vectorLayer = new VectorLayer({
  source: new VectorSource({
    url: '/test.geojson',
    format: new GeoJSON()
  }),
  style: styleFunction
});

console.info(vectorLayer.getFeatures);
for(var i = 0; i < vectorLayer.getSource().getFeatures().length; i++) { 
  
  if(vectorLayer.features[i].attributes.searchedAttribute == 'Name')
   { selectFeatureControl.select(vectorLayer.features[i]); break; } 
  }

function mouseX(evt) {
  if (evt.pageX) {
      return evt.pageX;
  } else if (evt.clientX) {
     return evt.clientX + (document.documentElement.scrollLeft ?
         document.documentElement.scrollLeft :
         document.body.scrollLeft);
  } else {
      return null;
  }
}

function mouseY(evt) {
  if (evt.pageY) {
      return evt.pageY;
  } else if (evt.clientY) {
     return evt.clientY + (document.documentElement.scrollTop ?
     document.documentElement.scrollTop :
     document.body.scrollTop);
  } else {
      return null;
  }
}



var map = new Map({
  controls: defaultControls().extend([mousePositionControl]),
  layers: [
    new TileLayer({
      source: new OSM()
    }),
    vectorLayer
  ],
  target: 'map',
  view: new View({
    projection: 'EPSG:4326',
    center: [0, 0],
    zoom: 2
  })
});

function flyToStore(currentFeature) {
  map.flyTo({
    center: currentFeature.geometry.coordinates,
    zoom: 15
  });
  console.info(currentFeature.geometry.coordinates);
  }
  
map.on('click', function(evt){
  
  document.getElementById("showOnPointermove").className = "hide";
  if (evt.dragging) {
    return;
  } 
  if (evt!=null) {
    feature = map.forEachFeatureAtPixel(
        evt.pixel, function(ft, l) { return ft; }
    );
    if (feature) {
      document.getElementById("stImageOnClick").src = feature.get('Link_Main_');
      document.getElementById("stNameOnClick").innerHTML = feature.get('Name');
      document.getElementById("stNameOnClick").href = feature.get('Link_Main_');
      document.getElementById("Country").innerHTML = feature.get('Country');
      document.getElementById("Location").innerHTML = feature.get('Location');
      document.getElementById("Tree_Speci").innerHTML =  feature.get('Tree_Speci');
      document.getElementById("Alpine_Veg").innerHTML = feature.get('Alpine_Veg');
      document.getElementById("Date").innerHTML = feature.get('Date');
      document.getElementById("Latitude").innerHTML = feature.get('Latitude');
      document.getElementById("Elevation_").innerHTML = feature.get('Elevation_');
      document.getElementById("Elevation1").innerHTML = feature.get('Elevation1');
      document.getElementById("State_Regi").innerHTML = feature.get('State_Regi');
      document.getElementById("Mountain_r").innerHTML = feature.get('Mountain_r');
      document.getElementById("more").href = feature.get('Link_Main_');
      ob = document.getElementById("showOnClick");
      ob.className = "onClick";  
      ob.style.left = left/2 - 150+ "px";
      ob.style.width = 120 + "px";
      ob.style.maxHeight = left -10 + "px";
      //ob.style.top =  mouseY(event) + 'px';
      //ob.style.left = mouseX(event) + 'px';
      window.event.returnValue = false;
    }  
  }
});

map.on('pointermove', function(evt){
  
  if (evt.dragging) {
    return;
  }
  //alert(evt.pixel);
  ob = document.getElementById("showOnPointermove");
  if (evt!=null) {
    feature = map.forEachFeatureAtPixel(
        evt.pixel, function(ft, l) { return ft; }
    );
    map.forEachFeatureAtPixel(
      evt.pixel, function(ft, l) { return ft; }
  );
    if (feature) {
      
      //document.getElementById("showOnClick").className = "hide";
      document.getElementById("stImage").src = feature.get('Link_Main_');
      document.getElementById("stName").innerHTML = feature.get('Name');
      document.getElementById("stName").href = feature.get('Link_Main_');
      ob.className = "onHover";  
      ob.style.top =  mouseY(event) + 'px';
      ob.style.left = mouseX(event) + 'px';
    
      window.event.returnValue = false;
      if (evt.dragging) {
        ob.className = "onHover";  
        ob.style.top =  "0" + 'px';
        ob.style.left = "0" + 'px';
        return;
    }
      //console.info(evt.coordinates);
        //you can see all properties with getProperties()
      //console.info(feature.getProperties());
        //and you can get directly a property
      //console.info(feature.get('Name'));
    }
  }
});
